// Intentar una importación más explícita
const { createRouter, createWebHistory } = require('vue-router');
import RegisterComponent from '../components/RegisterComponent.vue';
import LoginComponent from '../components/LoginComponent.vue';
import BusinessInfoComponent from '../components/BusinessInfoComponent.vue';
import MenuComponent from '../components/MenuComponent.vue';
import ShareMenuComponent from '../components/ShareMenuComponent.vue';
import SharedMenuView from '../components/SharedMenuView.vue';

const routes = [
  {
    path: '/',
    redirect: '/register'
  },
  {
    path: '/register',
    name: 'Register',
    component: RegisterComponent
  },
  {
    path: '/login',
    name: 'Login',
    component: LoginComponent
  },
  {
    path: '/business-info',
    name: 'BusinessInfo',
    component: BusinessInfoComponent
  },
  {
    path: '/menu',
    name: 'Menu',
    component: MenuComponent
  },
  {
    path: '/share-menu',
    name: 'ShareMenu',
    component: ShareMenuComponent
  },
  {
    path: '/menu/:menuId',
    name: 'SharedMenu',
    component: SharedMenuView
  }
];

// Asegúrate de que vue-router está correctamente instalado
const router = createRouter({
  history: createWebHistory(),
  routes
});

export default router;
